  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:19.068201\",\n\t\"name\": \"bitter-creek-national-wildlife-refuge-water-infrastructure-assessment-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a visit to Bitter
  Creek NWR on October 15th-18th, 2012, to locate and GPS water structures, springs,
  and other water sources. This report also includes a geospatial dataset.The UC Davis
  Center for Watershed Sciences (CWS) and Region 8 Inventory and Monitoring (I&M)
  Program visited the Bitter Creek NWR on October 15th-18th, 2012 to locate all water
  structures (tanks, troughs, wells, pipelines, turnouts, etc.), springs, and water
  sources. The objectives of this report were to verify locations of known springs
  from existing spatial data and hand drawn maps; look for evidence of underground
  pipes; verify locations of tanks and cattle troughs; and measure specific conductivity
  in tanks if water was present (to determine if sources were similar). The information
  learned from this field visit would be used to update the infrastructure dataset
  and learn more about the system of underground pipes.\",\n\t\"license_title\": \"License
